import React, { useState } from 'react';

import Header from './Header';

function App() {
  const counter = useState(0);

  function increment() {
    counter += 1;
    console.log(counter);
  }

  return (
    <div>
      <Header>Counter: {counter}</Header>
      <button>Increment</button>
    </div>
  );
}

export default App;
